// import $ from "jquery";

function clickTesteo(state) {

	console.log( `clicktesteo` );

	var cars = [
		{ type: "Lion" },
		{ type: "Rabbit" },
		{ type: "Wolf" }
	  ]
	// var autos = JSON.parse( cars )
	console.log( typeof cars );
	console.log( cars );
	state(cars)
	
};

export { clickTesteo }
